import React, {Fragment} from 'react'
import {NavLink} from 'react-router-dom'
export const Navbar = (props) => {
  const {logged_in, username} = props;
  console.log(props);
  let label;
  let menu;
  if (logged_in){
    label = <p className="m-0 pr-2 align-baseline"><b>@{username}</b></p>
    menu = <div className="collapse navbar-collapse" id="navbarToggler">
    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
      <li className="nav-item">
        <NavLink className="nav-link" to="/" exact><span className="sr-only">(current)</span>Home</NavLink>
      </li>
      <li className="nav-item">
        <NavLink className="nav-link" to="/About">About</NavLink>
      </li>
    </ul>
    {label}
    <form className="form-inline my-2 my-lg-0">
      <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
      {/* <button className="btn btn-outline-success my-2 my-sm-0 mr-2" type="submit">Search</button> */}
    </form>
    <button className="btn btn-outline-info" onClick={props.handle_logout} >Logout</button>
  </div>
  }

    return (
      <nav className="navbar navbar-expand-md navbar-light bg-light">
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggler" aria-controls="navbarToggler" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <NavLink className="navbar-brand" to="/">Microblog</NavLink>
        {menu}

    </nav>
    )

